'''Cầu Thủ Bộ''' bắc qua [[sông Cần Giuộc]] nối liền hai xã [[Long An, Cần Giuộc|Long An]] và [[Long Phụng, Cần Giuộc|Long Phụng]] thuộc địa phận huyện [[Cần Giuộc]], tỉnh [[Long An]]. Khởi công vào ngày [[20 tháng 9]] năm [[2001]], Cầu có chiều dài 544 [[Mét|m]], rộng 12 [[Mét|m]], tổng vốn đầu tư [[xây dựng]] công trình là 83 tỷ đồng, thời gian thi công 18 tháng<ref>[http://nld.com.vn/80704p0c1002/long-an-khoi-cong-xay-dung-cau-thu-bo-bac-qua-song-can-giuoc.htm Khởi công xây dựng cầu Thủ Bộ bắc qua sông Cần Giuộc], Báo Người Lao động</ref>.
